import React from "react";
import foodTypes from "../foodTypeData2"

const MenuFood = () => {
  console.log(Object.keys(foodTypes));


  Object.values(foodTypes.meat).forEach(item => {
    console.log(item.name);
  })
  Object.values(foodTypes.dairy).forEach(item => {
    console.log(item.name);
  })
  return (
    <div className="menu-food">
      <h3>Choose an ingredient / prep method.</h3>
      <ul>
        {Object.values(foodTypes.dairy).forEach(item => <li>item.name</li>)}
      </ul>
    </div>
  );
};

export default MenuFood;
